Description:
### Description

The PR fixes the issue #81409. To fix the issue the procedure of determining start and end indices for adaptive max pooling and average pooling is modified towards integer-only arithmetic. 



### Testing

The testing of the new functions is straightforward:



```

#include <iostream>

#include <cassert>

#include <cmath>



int64_t start_index(int64_t a, int64_t b, int64_t c) {

  return (int64_t)std::floor((float)(a * c) / b);

}



int64_t end_index(int64_t a, int64_t b, int64_t c) {

  return (int64_t)std::ceil((float)((a + 1) * c) / b);

}





int64_t start_index_new(int64_t a, int64_t b, int64_t c) {

  return (a / b) * c + ((a % b) * c) / b;

}



int64_t end_index_new(int64_t a, int64_t b, int64_t c) {

  return 1 + ((a + 1) * c - 1) / b;

}





int main() {

    size_t N = 2<<24;

    std::cout<<N<<'\\n';

    int64_t c = 1;



    for(int64_t i=1; i<N; i++) {

        for(int64_t j=1; j<N; j++) {

            int64_t s_id0 = start_index(i, j, c);

            int64_t s_id1 = start_index_new(i, j, c);

            assert(s_id0 == s_id1);

        }

    }



    for(int64_t i=1; i<N; i++) {

        for(int64_t j=1; j<N; j++) {

            int64_t e_id0 = end_index(i, j, c);

            int64_t e_id1 = end_index_new(i, j, c);

            assert(e_id0 == e_id1);

        }

    }

}

```

Stack from [ghstack](https://github.com/ezyang/ghstack):
* #43718 make jvp use forward mode by default
* #43717 Add gradcheck for forward grad
* #43716 Add many forward grad
* **#43715 Basic auto formula for forward grad**
* #43714 make sure SavedVariable propagate fw_grad properly
* #43713 Add forward grad mode in python and c++
* #43712 Add fw_grad field and accessors


As an example, below are the generated code for the two functions changed here:



For abs, it adds the following block of code at the end of the function (just before the return statement):

```cpp

  if (FwGradMode::is_enabled() && (isFwGradDefined(self))) {

      NoFwGradGuard guard;

      auto self_fw_grad = toLegacyFwGrad(self);

      auto result_new_fw_grad = self_fw_grad * self.sign();

      result.set_fw_grad(result_new_fw_grad);

  }

```

Note that the inplace version of abs, `abs_`  that uses the same entry in derivatives.yaml gets the following line added:

```cpp

  TORCH_CHECK(!(FwGradMode::is_enabled() && (isFwGradDefined(self))), "Trying to use forward prop with abs_ (because it is inplace) that does not support it.");

```



For as_strided, it adds the following:

```cpp

  if (FwGradMode::is_enabled() && (isFwGradDefined(self))) {

      NoFwGradGuard guard;

      auto self_fw_grad = toLegacyFwGrad(self);

      auto result_new_fw_grad = at::as_strided(self_fw_grad, size, stride, storage_offset);

      result.set_fw_grad(result_new_fw_grad);

  }

```



The full code for the abs function is thus:

```cpp

Tensor abs(const Tensor & self) {

  auto& self_ = unpack(self, "self", 0);

  std::shared_ptr<AbsBackward> grad_fn;

  if (compute_requires_grad( self )) {

    grad_fn = std::shared_ptr<AbsBackward>(new AbsBackward(), deleteNode);

    grad_fn->set_next_edges(collect_next_edges( self ));

    grad_fn->self_ = SavedVariable(self, false);

  }

  #ifndef NDEBUG

  c10::optional<Storage> self__storage_saved =

    self_.has_storage() ? c10::optional<Storage>(self_.storage()) : c10::nullopt;

  c10::intrusive_ptr<TensorImpl> self__impl_saved;

  if (self_.defined()) self__impl_saved = self_.getIntrusivePtr();

  #endif

  auto tmp = ([&]() {

    at::AutoNonVariableTypeMode non_var_type_mode(true);

    return at::abs(self_);

  })();

  auto result = std::move(tmp);

  #ifndef NDEBUG

  if (self__storage_saved.has_value())

    AT_ASSERT(self__storage_saved.value().is_alias_of(self_.storage()));

  if (self__impl_saved) AT_ASSERT(self__impl_saved == self_.getIntrusivePtr());

  #endif

  if (grad_fn) {

      set_history(flatten_tensor_args( result ), grad_fn);

  }

  if (FwGradMode::is_enabled() && (isFwGradDefined(self))) {

      NoFwGradGuard guard;

      auto self_fw_grad = toLegacyFwGrad(self);

      auto result_new_fw_grad = self_fw_grad * self.sign();

      result.set_fw_grad(result_new_fw_grad);

  }

  return result;

}

```

Differential Revision: [D23454143](https://our.internmc.facebook.com/intern/diff/D23454143)

re-opening PR, missed mypy issues, they are now addressed.

Example:



class TestModule(torch.nn.Module):

            def __init__(self):

                super().__init__()

                self.linear = torch.nn.Linear(4, 4)

                self.e = torch.rand(4)



            def forward(self, a, b):

                add_1 = a + b

                linear = self.linear(add_1)

                add_2 = linear + self.e

                return add_2

